import { Button, makeStyles, TextField, Typography } from '@mui/material'
import { Box } from '@mui/system'
import React,{useState} from 'react'

 const Login = () => {
    const [ loginCredentials, setLoginCredentials] = useState({
      userEmail : '',
      userPassword : ''
    })
    const useStyles = makeStyles(() => ({
      loginForm : {
        maxWidth : '400px',
        display : 'flex', 
        flexDirection : 'column', 
        alignItems : 'center', 
        justigyContent : 'center',
        padding : '2px',
        margin : 'auto', 
        marginTop : '10px',
        boxShadow : '10px 10px 20px #ccc',
        borderRadius : '5px'
      }
    }))
    const changeCredentialHandler = (event) => {
      setLoginCredentials({
        [event.target.name] : event.target.value
      })
    }
    const loginHandler = (event) => {
      event.preventDefault()
    }
    return(<>
      <form>
        <Box className = {classes.loginForm}>
          <Typography padding={1} textAlign="center">Login</Typography>
          <TextField type={'email'} name='userEmail' value={loginCredentials.userEmail} onChange={changeCredentialHandler} placeholder='enter your email' margin='normal'/>
          <TextField type={'password'} name='userPassword' value={loginCredentials.userPassword} onChange={changeCredentialHandler} placeholder='enter your password' margin='normal'/>
          <Button type='submit' onClick={loginHandler}>Submit</Button>
          <Button>Back To Signup</Button>
        </Box>
      </form>
    </>)
 }

 export default Login
